import React from 'react';
import NavBar from '../../NavBar/navbar';
import '../Home/Home.css';

function Home() {
    return (
        <div>
            <NavBar />
            <div class="main columns">
                <section class="column main-column">
                    <a class="article first-article" href="#">
                        <figure class="article-image is-4by3">
                            <img src="/img/facebook.jpg" alt="" />
                        </figure>
                        <div class="article-body">
                            <h2 class="article-title">Daily Crunch: Facebook drops the Oculus Go</h2>
                            <p class="article-content">Facebook  shifts its VR strategy, WhatsApp’s payment service hits a snag in Brazil and we look at how Trump’s visa ban will affect Silicon Valley.</p>
                        </div>
                    </a>
                </section>
            </div>
        </div>
    )
}

export default Home;
